import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div className="home">
      <h1>Welcome to AI Code Generator</h1>
      <p>Get started by chatting with our AI to generate code!</p>
      <Link to="/chat" className="cta-button">
        Start Chatting
      </Link>
    </div>
  );
}

export default Home;
